import React from "react";
import { Navbar, Nav, Row, Col, Container } from "react-bootstrap";
import { NavItem, NavIcon, NavText } from "@trendmicro/react-sidenav";
import "./index.css";
class Headbar extends React.Component {
  render() {
    return (
      <Navbar fixed="top" expand="lg" bg="dark" variant="dark" className="">
        <Nav.Item className="d-none d-md-flex justify-content-between align-items-center">
          <div className="mr-4">
            <img
              src={imageURI + data.photo}
              style={{ borderRadius: "10px" }}
              width="52px"
              height="52px"
              alt="profile"
            />
          </div>
          <div className="mr-4">
            <div className="text bold">{data.name}</div>
            <div className="small">+62 {splitPhone(data.phone)}</div>
          </div>
          <div className="mr-4 icon">
            <img
              onClick={() => dispatch(notification())}
              style={{ cursor: "pointer" }}
              id="bell"
              src={bell}
              alt="bell"
            />
          </div>
        </Nav.Item>
        <Nav.Item className="logo primary d-flex align-items-center">
          <div className="mr-4">
            <img
              src={require("../assets/logo/logo.png")}
              style={{ borderRadius: "10px" }}
              width="32px"
              height="32px"
              alt="logo"
            />
          </div>
        </Nav.Item>
        <Nav.Item className="d-none d-md-flex justify-content-between align-items-center">
          Berkat Kawan Sakti Bersama
          <div className="mr-4">
            <div className="text bold">name</div>
            <div className="small">+62 </div>
          </div>
        </Nav.Item>
        {/* </Container> */}
        <Navbar.Brand href=""></Navbar.Brand>
      </Navbar>
    );
  }
}

export default Headbar;

